import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};

const headerSTyle = {
	marginRight: 40
};

const Header = () => (
  <div style={headerSTyle}>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);

export default Header;
